import React from "react";

const User = (props) => {
  return (
    <div
      style={{
        backgroundColor: "red",
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        width: "auto",
      }}
    >
      <h1>
        I'm {props.name} and I am {props.age} years old!
      </h1>
      <h3>{props.children}</h3>
    </div>
  );
};

export default User;
